CONTRATAÇÃO DA FUNDAÇÃO DE APOIO À PESQUISA - FUNAPE PARA SUPORTE À REALIZAÇÃO DE AÇÃO DE DESENVOLVIMENTO DE MÉDIA DURAÇÃO, NO ÂMBITO DO PROGRAMA LIDERAGOV, 3ª EDIÇÃO, COM O OBJETIVO DE CONSTITUIR UMA REDE DE SERVIDORES PÚBLICOS COM ALTA CAPACIDADE DE GESTÃO E LIDERANÇA, APTOS A OCUPAR CARGOS E FUNÇÕES ESTRATÉGICAS NA ADMINISTRAÇÃO PÚBLICA FEDERAL, POR MEIO DO APOIO À GESTÃO ADMINISTRATIVA E FINANCEIRA ESTRITAMENTE NECESSÁRIA A EXECUÇÃO DESSE PROJETO.

SÃO ANEXOS A ESTE INSTRUMENTO E VINCULAM ESTA CONTRATAÇÃO, INDEPENDENTEMENTE DE TRANSCRIÇÃO:

O TERMO DE REFERÊNCIA QUE EMBASOU A CONTRATAÇÃO;

O EDITAL DE LICITAÇÃO, A AUTORIZAÇÃO DE CONTRATAÇÃO DIRETA E/OU O AVISO DE DISPENSA ELETRÔNICA, CASO EXISTENTES;

A PROPOSTA DO CONTRATADO; E

EVENTUAIS ANEXOS DOS DOCUMENTOS SUPRACITADOS.
